export interface EventsDestroyParams {
    /**
    * The id of the Direct Message event that should be deleted.
    */
    'id': string;
}
export interface EventsShowParams {
    /**
    * The id of the Direct Message event that should be returned.
    */
    'id': string;
}
export interface EventsListParams {
    /**
    * Max number of events to be returned. 20 default. 50 max.
    */
    'count'?: string | number;
    /**
    * For paging through result sets greater than 1 page, use the “next_cursor” property from the previous request.
    */
    'cursor'?: string;
}
export interface EventsNewParams {
    /**
    * Event object of the message event to send
    */
    'event': {
        type: string;
        message_create: {
            target: {
                recipient_id: string;
            };
            message_data: {
                text: string;
                quick_reply?: {
                    type: string[];
                };
                attachment?: {
                    type: string;
                    media: {
                        id: string;
                    };
                };
            };
        };
    };
}
